  return (
      <>

        <div id='main'>
          <h1>Next to play : {player}</h1>
          <div>
            <Square />
            <Square />
            <Square />
          </div>
          <div>
            <Square />
            <Square />
            <Square />
          </div>
          <div>
            <Square />
            <Square />
            <Square />
          </div>
        </div>
      </>
  );
}

function Square() {
    const [value,setValue] = useState(null);

    function changeText(){
      setValue("x");
    }

    return (
      <button className='Square' onClick={changeText}>
        {value}
      </button>
    );
  }
